export class CustomValidators {
  static notOnlyWhitespace(control) {
    if (control.value == null || control.value.trim().length === 0) {
      return {
        'notOnlyWhitespace': true
      };
    } else {
      return null;
    }
  }

  static exactLength(exactLength) {
    return control => {
      if (control.value != null && control.value.length !== exactLength) {
        return {
          'exactLength': true
        };
      }

      return null;
    };
  }

  static exactTwoLengths(firstLength, secondLength) {
    return control => {
      if (control.value != null && control.value.length !== firstLength && control.value.length !== secondLength) {
        return {
          'exactTwoLengths': true
        };
      }

      return null;
    };
  }

}
